import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignupAndLogin from './components/SignupAndLogin';
import Dashboard from './components/Dashboard';
import ProductManagement from './components/ProductManagement';  // Import Product Management
import UserManagement from './components/UserManagement';  // Import User Management

function App() {
  return (
    <Router>
      <Routes>
        {/* Define the root route ("/") */}
        <Route path="/" element={<SignupAndLogin isLogin={false} />} />

        {/* Define routes for signup, login, and other components */}
        <Route path="/signup" element={<SignupAndLogin isLogin={false} />} />
        <Route path="/login" element={<SignupAndLogin isLogin={true} />} />
        <Route path="/dashboard" element={<Dashboard />} />
        
        {/* Routes for Product and User Management */}
        <Route path="/product-management" element={<ProductManagement />} />
        <Route path="/user-management" element={<UserManagement />} />
      </Routes>
    </Router>
  );
}

export default App;
